import React, { Component } from "react";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBBtn,
} from "mdbreact";
import { BrowserRouter as Router, Link } from "react-router-dom";
import { Fragment } from "react";

class NavbarPage extends Component {
  state = {
    isOpen: false,
  };

  toggleCollapse = () => {
    this.setState({ isOpen: !this.state.isOpen });
  };

  render() {
    return (
      <Router>
        <MDBNavbar color="grey darken-4" dark expand="md" fixed="top">
          <MDBNavbarBrand>
            <strong className="white-text">Moncoiffeur</strong>
          </MDBNavbarBrand>
          <MDBNavbarToggler onClick={this.toggleCollapse} />
          <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
            <MDBNavbarNav left>
              <MDBNavItem active>
                <MDBNavLink to="#!">Qui est nous ?</MDBNavLink>
              </MDBNavItem>
            </MDBNavbarNav>
            <MDBNavbarNav right>
              {" "}
              <Fragment>
                <Link to="/loginpro">
                  <MDBBtn color="primary">Ajouter votre salon</MDBBtn>
                </Link>
                <Link to="/loginclient">
                  <MDBBtn color="default">Mon compte</MDBBtn>{" "}
                </Link>
              </Fragment>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBNavbar>
      </Router>
    );
  }
}

export default NavbarPage;
